drop table creditinfo;

CREATE TABLE creditinfo ( 
  CREDITINFO_JOBBIZ VARCHAR2(30),  
  CREDITINFO_TOTALINCOME1 NUMBER(11),  
  CREDITINFO_TOTALINCOME2 NUMBER(11),  
  CREDITINFO_CREDIT VARCHAR2(5),  
  CREDITINFO_LOANPERIOD NUMBER(4),  
  CREDITINFO_RATE NUMBER(4, 2)
);



select count(*) from creditinfo;